  \"2015-09-27T02:09:10.232039\",\n\t\"name\": \"glacier-inventory-of-west-greenland\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"nThe inventory includes 5,297 Glaciers
  from west Greenland between 59 to 71 degrees latitude north and 43 to 53 degrees
  longitude west. The glacier data basin division is based on a simplified version
  of the World Glacier Monitoring Service (WGMS) system.  Data are based on 1:250000
  maps, Landsat imagery, and aerial photos that were taken between 1948 and 1985.n\",\n\t\"license_title\":
